import './App.css';
import Form from 'bootstrap-form';

function App() {

  return (
    <div>
      <header className="header">
        <h1>Brutus A/S</h1>
      </header>
      <div className="inputForm">
        <form>
          <div class="form-group">
          <label>
              Name:
              <br/><input type="text" class="form-control" name="name" />
          </label>
          </div>
          <input type="submit" value="Submit" />
        </form>
      </div>
    </div>
  );
}

export default App;
